import React from 'react';


function Cool() {
    return (
        <div>
            <h1>You have a Cool skin tone! </h1>
            <img className='toneImg' alt="" src="https://img1.thelist.com/img/gallery/the-best-clothing-colors-for-your-skin-tone/colors-for-cool-skin-tones-1469847523.jpg" />
            <h3 className='resultDescr'>If you fall under this category, try sticking to jewel-toned makeup and clothing, including blue, purple, blue-green, green, magenta, and bluish-red shades. For foundation, you'll probably look best in formulations with a bluish or pink undertone. And be sure to reach for the black mascara when it comes to eye makeup; it's sure to make your eyes pop.</h3>
        </div>
    );
};



export default Cool;
